Storyline:

   Founded in 1910 just outside of the city limits of Gilbert located in Lanville County, Texas, the Chicken Ranch has for generations been known as the best whorehouse in Texas for its wholesome fun, strict moral code and cleanliness, all perpetuated by its original owner, Miss Wulla Jean. Seven years ago, Miss Wulla Jean passed on, leaving the Chicken Ranch to her favorite working girl, Miss Mona Stangley, who wants to keep the same traditions of Miss Wulla Jean. The Chicken Ranch has always had the unofficial blessing of the local authorities, who see the ranch providing an important community service, one which most in local authority have used at one time or another in their life. In fact, Miss Mona and Lanville County Sheriff Ed Earl Dodd have been in a relationship for years, Ed Earl who is Miss Mona's protector, albeit one with a hot temper and good ol' boy attitude that doesn't exactly match the needs of his law upholding position.


